import datetime
import pandas as pd
import matplotlib.pyplot as plt
from functools import cmp_to_key
import seaborn

plt.close("all")

# Read the CSV into a pandas data frame (df)
population_df = pd.read_csv('Population Data.csv', delimiter=',')

# Export it as a list of dicts
population_dict = population_df.to_dict("records")

# print(population_dict)

# Read the CSV into a pandas data frame (df)
temp_df = pd.read_csv('Temperature Data.csv', delimiter=',')

# Export it as a list of dicts
temp_dict = temp_df.to_dict("records")

# print(temp_dict)

# Create map of city -> population
city_pop_map = {}
total_pop = 0
for pop in population_dict:
    city_pop_map[pop["City"]] = pop["population"]
    total_pop = total_pop + pop["population"]

# For each date from 1/1/2015+, track the avg, min, max temps for every city
# Need: {date: {city: {"avg" : x, "min": y, "max": z}}}
date_city_map = {}

for temp in temp_dict:
    if not temp["location_date"] in date_city_map:
        date_city_map[temp["location_date"]] = {}

    date_city_map[temp["location_date"]][temp["name"]] = {
        "avg": temp["temp_mean_c"],
        "min": temp["temp_min_c"],
        "max": temp["temp_max_c"],
        "isRealData": True
    }

# print(date_city_map)

start_date = datetime.datetime(2015, 1, 1, 0, 0, 0)
curr_date = start_date
end_date = datetime.datetime(2021, 4, 20, 0, 0, 0)
# Loop through each date and fill in missing ones in the dataset
while curr_date <= end_date:
    date_string = curr_date.strftime("%-m/%-d/%Y")
    for city_temp in temp_dict:
        city = city_temp["name"]
        if city not in date_city_map[date_string]:
            # missing date, perform fill logic
            # print("Date: " + date_string + " missing in city: " + city)
            # if start date, go to next date and use that
            if curr_date == start_date:
                move_forward = curr_date
                while move_forward <= end_date:
                    move_forward = move_forward + datetime.timedelta(days=1)
                    if city in date_city_map[move_forward]:
                        date_city_map[curr_date][city] = {
                            "avg": date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["avg"],
                            "min": date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["min"],
                            "max": date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["max"],
                            "isRealData": False
                        }
                        break

            # if end date, go backwards and use that
            elif curr_date == start_date:
                move_back = curr_date
                while move_back <= end_date:
                    move_back = move_back + datetime.timedelta(days=-1)
                    if city in date_city_map[move_back.strftime("%-m/%-d/%Y")]:
                        date_city_map[curr_date.strftime("%-m/%-d/%Y")][city] = {
                            "avg": date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["avg"],
                            "min": date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["min"],
                            "max": date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["max"],
                            "isRealData": False
                        }
                        break

            # else, go both ways and do an average
            else:
                move_forward = curr_date
                move_back = curr_date
                back_found = False
                forward_found = False
                while move_forward <= end_date:
                    if city in date_city_map[move_forward.strftime("%-m/%-d/%Y")]:
                        forward_found = True
                        break
                    move_forward = curr_date + datetime.timedelta(days=1)
                while move_back <= end_date:
                    if city in date_city_map[move_back.strftime("%-m/%-d/%Y")]:
                        back_found = True
                        break
                    move_back = curr_date + datetime.timedelta(days=-1)

                # now we have a forward and back (maybe)
                # if we have both, use the average from each one
                # if only one, use that one
                if forward_found and back_found:
                    new_avg = (date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["avg"] + date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["avg"]) / 2
                    new_min = (date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["min"] + date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["min"]) / 2
                    new_max = (date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["max"] + date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["max"]) / 2

                    date_city_map[curr_date.strftime("%-m/%-d/%Y")][city] = {
                        "avg": new_avg,
                        "min": new_min,
                        "max": new_max,
                        "isRealData": False
                    }
                elif forward_found:
                    new_avg = date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["avg"]
                    new_min = date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["min"]
                    new_max = date_city_map[move_forward.strftime("%-m/%-d/%Y")][city]["max"]

                    date_city_map[curr_date.strftime("%-m/%-d/%Y")][city] = {
                        "avg": new_avg,
                        "min": new_min,
                        "max": new_max,
                        "isRealData": False
                    }

                else:
                    new_avg = date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["avg"]
                    new_min = date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["min"]
                    new_max = date_city_map[move_back.strftime("%-m/%-d/%Y")][city]["max"]

                    date_city_map[curr_date.strftime("%-m/%-d/%Y")][city] = {
                        "avg": new_avg,
                        "min": new_min,
                        "max": new_max,
                        "isRealData": False
                    }

    curr_date = curr_date + datetime.timedelta(days=1)

# We now have a complete time series
# Convert it into our desired graphs now

# Goal:
# x axis - date
# y axis - temperature * (city pop / total pop)
final_timeseries = {}
for date in date_city_map:
    count = 0
    weighted_total = 0
    weighted_min = 10000
    weighted_max = -10000
    for city in date_city_map[date]:
        if city in city_pop_map:
            city_pop = city_pop_map[city]
            factor = city_pop / total_pop
            avg_with_factor = date_city_map[date][city]["avg"] * (factor + 1)
            min_with_factor = date_city_map[date][city]["min"] * (factor + 1)
            max_with_factor = date_city_map[date][city]["max"] * (1 - factor)

            if min_with_factor < weighted_min:
                weighted_min = min_with_factor

            if max_with_factor > weighted_max:
                weighted_max = max_with_factor

            weighted_total = weighted_total + avg_with_factor
            count = count + 1

    date_avg = weighted_total / count
    final_timeseries[date] = {
        "avg": date_avg,
        "min": weighted_min,
        "max": weighted_max
    }

print(final_timeseries)

sorted_dict = dict(reversed(sorted(final_timeseries.items(), key=cmp_to_key(lambda item1, item2: datetime.datetime.strptime(str(item1[0]), "%m/%d/%Y") > datetime.datetime.strptime(str(item2[0]), "%m/%d/%Y")))))
