# Graph 2 - monthly version of graph 1
sum_count_map = {}
for date_string in sorted_dict:
    # Convert to date time
    dt = datetime.datetime.strptime(date_string, "%m/%d/%Y")
    month_year = str(dt.month) + "/" + str(dt.year)
    if month_year not in sum_count_map:
        sum_count_map[month_year] = {
            "avg": {
                "total": sorted_dict[date_string]["avg"],
                "count": 1
            },
            "min": {
                "total": sorted_dict[date_string]["min"],
                "count": 1
            },
            "max": {
                "total": sorted_dict[date_string]["max"],
                "count": 1
            }

        }
    else:
        sum_count_map[month_year]["avg"]["total"] = sum_count_map[month_year]["avg"]["total"] + sorted_dict[date_string]["avg"]
        sum_count_map[month_year]["avg"]["count"] = sum_count_map[month_year]["avg"]["count"] + 1

        sum_count_map[month_year]["min"]["total"] = sum_count_map[month_year]["min"]["total"] + sorted_dict[date_string]["min"]
        sum_count_map[month_year]["min"]["count"] = sum_count_map[month_year]["min"]["count"] + 1

        sum_count_map[month_year]["max"]["total"] = sum_count_map[month_year]["max"]["total"] + sorted_dict[date_string]["max"]
        sum_count_map[month_year]["max"]["count"] = sum_count_map[month_year]["max"]["count"] + 1

print(sum_count_map)
# Now do the math
graph_2_map = {}
for month in sum_count_map:
    graph_2_map[month] = {
        "avg": sum_count_map[month]["avg"]["total"] / sum_count_map[month]["avg"]["count"],
        "min": sum_count_map[month]["min"]["total"] / sum_count_map[month]["min"]["count"],
        "max": sum_count_map[month]["max"]["total"] / sum_count_map[month]["max"]["count"],
    }

print(graph_2_map)
